import React from 'react';
import { BrowserRouter as Router, Redirect, Route } from 'react-router-dom';
import Users from './users/pages/users';
import NewPlace from './places/pages/NewPalce'

const App = () => {
  return (
  <Router>
    <Route path="/" exact>
      <Users/>
    </Route>
    <Route path="/places/new" exact>
      <NewPlace/>
    </Route>
    <Redirect to="/" />

  </Router>

  )
}

export default App;
